import React from 'react';
import { GlobalStyle, WeatherCard, Code, BreakLine, Subtitle } from '../../styles/styles';
import { findLanguageByKey } from '../../languages/Languages';
import { useLocation } from 'react-router-dom';
const SocialNetwork = () => {
	const { state } = useLocation();
	console.log(state);
	const fullLanguage = null; //findLanguageByKey(actualLanguage);
	return (
		<>
			<GlobalStyle />
			<WeatherCard>
				<code>{fullLanguage.socialNetworks.myInfo}</code>
			</WeatherCard>
		</>
	);
};

export default SocialNetwork;
